import React from 'react';

const Search = () => {
    return (
        <div>
            <form id="hashtag-form" action="/hashtag">
                <input type="text" name="hashtag" placeholder="태그 검색" />
                    <button className="btn">검색</button>
            </form>
        </div>
    );
};

export default Search;
